encoded_data_list = []
for embedding in embeddings:
    # 将嵌套浮点数列表转换为numpy数组，dtype设为float32
    array = np.array(embedding, dtype=np.float32)
    # 将numpy数组转化为字节串
    data_bytes = array.tobytes()
    # 使用base64进行编码
    encoded_data = base64.b64encode(data_bytes)
    # 将编码后的字节串转为str并添加到结果列表中
    encoded_data_list.append(encoded_data.decode('utf-8'))

for encoded_data in encoded_data_list:
    print(f"encoded_data:{encoded_data}")
    decode = np.frombuffer(
        base64.b64decode(encoded_data), dtype="float32"
    ).tolist()
    print(f"decode:{decode}")
